import { Outlet, Link, useLocation } from "react-router-dom";
import { useSelector } from "react-redux";

function Section() {
  const DATA = useSelector(state => state.data);
  const location = useLocation();
  const sectionProps = location.state

  return (
    <div className="Section">
      {DATA[sectionProps].map(item => {
        return (
          <div key={item.brand + item.model}>
            <Link state={item} to={`/${sectionProps}/${item.brand}${item.model}`}>
              {`${item.brand.charAt(0).toUpperCase()}${item.brand.slice(1)}
              ${item.model.charAt(0).toUpperCase()}${item.model.slice(1)}`}</Link>
          </div>
        )
      })}
      <Outlet />
    </div>
  );
}

export default Section;
